CREATE TABLE `_temp1` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `RewSpell` mediumint(8) unsigned NOT NULL default '0',
  PRIMARY KEY  (`entry`,`RewSpell`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE `_temp2` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `RewSpellCast` mediumint(8) unsigned NOT NULL default '0',
  PRIMARY KEY  (`entry`,`RewSpellCast`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
update quest_template set RewSpell=(select RewSpell from _temp1 as old where old.entry=quest_template.entry) where entry in (select entry from _temp1);
update quest_template set RewSpellCast=(select RewSpellCast from _temp2 as old where old.entry=quest_template.entry) where entry in (select entry from _temp2);
